class Solution {
    public int minSizeSubarray(int[] nums, int target) {
        int n = nums.length, minSize = Integer.MAX_VALUE;
        int[] prefixSums = new int[n + 1];
        for (int i = 0; i < n; ++i) prefixSums[i + 1] = prefixSums[i] + nums[i];

        if (prefixSums[n] == 0) return -1; // If the sum of all elements is 0, can't form target

        for (int i = 0; i < n; ++i) {
            for (int j = i; j < n; ++j) {
                int sum = 0;
                int rounds = target / prefixSums[n];
                if (rounds * prefixSums[n] < target) rounds++;
                sum += rounds * prefixSums[n];
                int extra = target - (sum - prefixSums[n]);

                if (prefixSums[j + 1] - prefixSums[i] >= extra) {
                    int size = rounds * n + (j - i + 1) - n;
                    if (size < minSize) minSize = size;
                }
            }
        }

        return minSize == Integer.MAX_VALUE ? -1 : minSize;
    }
}
